import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the "Sort by" select using label text as anchor, then select "Price: Low to High"
    // Try to use label text and then select element via its id
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });
    await page.waitForSelector('select#sortSelect', { timeout: 5000 });

    // Take screenshot before sort
    const step2 = path.join(screenshotsDir, 'step_2_before_sort.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Select "Price: Low to High" option (value="price-low")
    await page.selectOption('select#sortSelect', 'price-low');

    // Wait for the products grid/list to update (wait for a short while for DOM update)
    await page.waitForTimeout(800);

    // Take screenshot after sort
    const step3 = path.join(screenshotsDir, 'step_3_after_sort.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the titles and prices of the first 3 visible products to verify sort
    // Try to use .product-card or .product-card-list (grid or list)
    let products = await page.$$eval('.product-card, .product-card-list', nodes =>
      nodes.slice(0, 3).map(node => {
        const title = node.querySelector('.product-title')?.innerText || '';
        const priceText = node.querySelector('.product-price')?.innerText || '';
        // Extract first price number from priceText
        const priceMatch = priceText.match(/\$([0-9.,]+)/);
        const price = priceMatch ? priceMatch[1] : '';
        return { title, price };
      })
    );

    return {
      success: true,
      action: "Applied Price: Low to High sort filter and extracted top 3 product titles/prices",
      extractedData: {
        topProducts: products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
